import React from 'react';
import './App.css';
import LineGraph from './components/LineGraph';

function App() {
  return (
    <div className="App">
      <div>
        <div>
          <h1>Corona Virus Report</h1>
        </div>
      </div>
      <LineGraph/>
    </div>
  );
}

export default App;
